export function writeCall(
  buf: CmdBuf,
  offset: CommandPtr,
  result_slot: JSValueSlot,
  func_slot: JSValueSlot,
  this_slot: JSValueSlot,
  argc: Uint8,
  arg1: JSValueSlot,
  arg2: JSValueSlot,
  arg3: JSValueSlot,
  arg4: JSValueSlot,
  arg5: JSValueSlot,
  arg6: JSValueSlot,
  arg7: JSValueSlot,
  arg8: JSValueSlot,
  arg9: JSValueSlot,
  arg10: JSValueSlot,
  call_as_constructor: Uint8,
): void {
  setOpcode(buf, offset, 46)
  setSlotA(buf, offset, result_slot)
  setSlotB(buf, offset, func_slot)
  setSlotC(buf, offset, this_slot)
  setD1_u32(
    buf,
    offset,
    ((argc as number) & 0xff) |
      ((arg1 as number) & (0xff << 8)) |
      ((arg2 as number) & (0xff << 16)) |
      ((arg3 as number) & (0xff << 24)),
  )
  setD2_u32(
    buf,
    offset,
    ((arg4 as number) & 0xff) |
      ((arg5 as number) & (0xff << 8)) |
      ((arg6 as number) & (0xff << 16)) |
      ((arg7 as number) & (0xff << 24)),
  )
  setD3_u32(
    buf,
    offset,
    ((arg8 as number) & 0xff) |
      ((arg9 as number) & (0xff << 8)) |
      ((arg10 as number) & (0xff << 16)) |
      ((call_as_constructor as number) & (0xff << 24)),
  )
}

